Toshie Takahama &quot;The Complete Origami Collection&quot;
English | 1997-07 | ISBN: 0870409603 | 128 pages | PDF | 35,8 MB

The latest collection by bestselling origami author Takahama features over 100 designs for beginner, intermediate, and advanced folders. Each of these beautiful creations is illustrated in full color with step-by-step instructions. Projects include a samurai helmet, piano, butterfly, and pelican.
